// #5
// Write a function that takes in a word and returns the first letter of that word.
//
// Examples:
//
// input: "hello"
// output: "h"
//
// input: "away"
// output: "a"
//
// input: "excited"
// output: "e"

function firstLetter(word) {
  var firstLetter = word.charAt(0);
  console.log(firstLetter);
}

firstLetter("hello");
firstLetter("away");
firstLetter("excited");

