// #7
// Write a function that takes in a word and returns true if the word starts with a vowel, false otherwise.
//
// Examples:
//
// input: "hello"
// output: false
//
// input: "away"
// output: true
//
// input: "excited"
// output: true

function startsWithVowel(word) {
  var startsWithVowel = word.charAt(0) === "a" || word.charAt(0) === "e" || word.charAt(0) === "i" || word.charAt(0) === "o" || word.charAt(0) === "u";
  console.log(startsWithVowel);
}

startsWithVowel("hello");
startsWithVowel("away");
startsWithVowel("excited");

// #8
// Write a function that takes in a word and returns true if the word ends with a vowel, false otherwise.
//
// Examples:
//
// input: "hello"
// output: true
//
// input: "away"
// output: true
//
// input: "excited"
// output: true

function endsWithVowel(word) {
  var endsWithVowel = word.charAt(word.length - 1) === "a" || word.charAt(word.length - 1) === "e" || word.charAt(word.length - 1) === "i" || word.charAt(word.length - 1) === "o" || word.charAt(word.length - 1) === "u";
  console.log(endsWithVowel);
}

endsWithVowel("hello");
endsWithVowel("away");
endsWithVowel("excited");

