// #11
// Write a function that takes in two numbers and returns the smaller number.
//
// Examples:
//
// input: 3, 5
// output: 3
//
// input: 8, 4
// output: 4
//
// input: 3, 3
// output: 3

function smallerNum(num1, num2) {
  if (num1 < num2) {
    console.log(num1);
  } else if (num2 < num1) {
    console.log(num2);
  } else {
    console.log(num1);
  }
}

smallerNum(3, 5);
smallerNum(8, 4);
smallerNum(3, 3);

